import CodeIcon from '@material-ui/icons/Code';
import DesktopWindowsIcon from '@material-ui/icons/DesktopWindows';
const ServData = [
    {
        id: 1,
        imgsrc: <CodeIcon/>,
        title: 'WEB DEV',
        text: ' I design websites and develop websites, create high performance websites with blazing fast speed'
    },
    {
        id: 2,
        imgsrc:  <DesktopWindowsIcon/>,
        title: 'WEB DESIGN',
        text: ' I design responsive website banners and landing pages which justify your product or brand'
    },
    {
        id: 3,
        imgsrc:  DesktopWindowsIcon,
        title: 'FRONTEND DEV',
        text: ' I also manage the website and apps with frontend and backend technologies '
    }

];
export default ServData;
